import React from "react";

function About() {
  return (
    <div className="m-5 pt-5">
      <h1>About Page</h1>
      <p>
        This application serves to be a <strong> One Stop</strong> shop to find your quick references for common Programming Languages and Frameworks!
      </p>
    </div>
  );
}

export default About;
